        public override int CalculateWinLine(int lineNumber)
        {
            var l = GetLine(lineNumber, UnicornGlobalData.GameLineShifted);
            for (var i = 0; i < 5; i++)
            {
                if (l.GetElement(i) == 0)
                {
                    l.SetElement(i, 1);
                }
            }
            return l.CalculateLineWin(WinFor5HotStrike, WinForWild5HotStrike, 1, 1);
        }

        /// <summary>
        /// Konstruiše matricu na osnovu dvodimenzionalnog niza za igru 5HotStrike.
        /// </summary>
        /// <param name="matrix"></param>
        public void FromMatrixArray5HotStrike(int[,] matrix)
        {
            for (var i = 0; i < 5; i++)
            {
                for (var j = 0; j < 5; j++)
                {
                    SetElement(i, j, matrix[i, j]);
                }
            }
        }

        public int GetWinningElementForLine(int lineNumber, int win)
        {
            var l = GetLine(lineNumber, UnicornGlobalData.GameLineShifted);
            for (var i = 0; i < 5; i++)
            {
                if (l.GetElement(i) == 0)
                {
                    l.SetElement(i, 1);
                }
            }
            return l.GetWinningElement(1, win, WinForWild5HotStrike);
        }

        /// <summary>
        /// Daje niz pozicija za simbol.
        /// </summary>
        /// <param name="symbol"></param>
        /// <returns></returns>
        public byte[] GetScatterPositionsArray(int symbol)
        {
            var positions = new byte[5];
            var index = 0;
            for (var i = 0; i < 5; i++)
            {
                for (var j = 1; j < 4; j++)
                {
                    if (GetElement(i, j) == symbol)
                    {
                        positions[index++] = (byte)(j * 5 + i);
                    }
                }
            }
            for (; index < 5; index++)
            {
                positions[index] = 255;
            }
            return positions;
        }

        /// <summary>
        /// Daje pozicije dobitnih elemenata.
        /// </summary>
        /// <param name="lineNumber">Broj linije.</param>
        /// <param name="element">Simbol</param>
        /// <returns></returns>
        public byte[] GetLinesPositions(int lineNumber, int element)
        {
            var l = GetLine(lineNumber, UnicornGlobalData.GameLineShifted);
            var positionsArray = new byte[5];
            var i = 0;
            var elem = l.GetElement(i);
            while (elem <= 1 || elem == element)
            {
                positionsArray[i] = (byte)(UnicornGlobalData.GameLineShifted[lineNumber - 1, i] * 5 + i);
                i++;
                if (i == 5)
                {
                    break;
                }
                elem = l.GetElement(i);
            }
            for (; i < 5; i++)
            {
                positionsArray[i] = 255;
            }
            return positionsArray;
        }

