            var reelsSet = -1;
            var specReelSet = -1;
            var sum = 0.0;
            var rnd = SoftwareRng.Next();
            var n = _ReelProbs.Length;
            for (var i = 0; i < n; i++)
            {
                sum += _ReelProbs[i];
                if (rnd < sum)
                {
                    reelsSet = i;
                    break;
                }
            }
            sum = 0.0;
            rnd = SoftwareRng.Next();
            n = _ReelProbsSpec.Length;
            for (var i = 0; i < n; i++)
            {
                sum += _ReelProbsSpec[i];
                if (rnd < sum)
                {
                    specReelSet = i;
                    break;
                }
            }
            var mat = new int[5, 5];
            var matSpec = new int[5, 5];
            var k = SoftwareRng.Next(_Reels[reelsSet].Length);
            for (var i = 0; i < 5; i++)
            {
                var l = _Reels[reelsSet][k][i].Length;
                var p = SoftwareRng.Next(l);
                var lspec = _ReelSpecial[specReelSet][i].Length;
                var pspec = SoftwareRng.Next(lspec);
                for (var j = 0; j < 5; j++)
                {
                    mat[i, j] = _Reels[reelsSet][k][i][(p + j) % l];
                    matSpec[i, j] = _ReelSpecial[specReelSet][i][(pspec + j) % lspec];
                }
            }
            for (var i = 0; i < 5; i++)
            {
                for (var j = 0; j < 5; j++)
                {
                    mat[i, j] = Math.Min(mat[i, j], matSpec[i, j]);
                }
            }
            return mat;
        }

